class ToggleLike{constructor(e){this.toggler=e,this.toggleLike()}toggleLike(){$(this.toggler).click(e=>{e.preventDefault();let l=this;$.ajax({type:"POST",url:$(l.toggler).attr("href")}).done(function(e){console.log("data",e);let t=parseInt($(l.toggler).attr("data-likes"));console.log("data.data.deleted",e.data.deleted),console.log(t),!0===e.data.deleted&&0<t?--t:t+=1,$(l.toggler).attr("data-likes",t),$(l.toggler).html(t+" Likes")}).fail(function(e){console.log("error in completing the request")})})}}